tables.table_schema:
CREATE TABLE data ( 
  id INT PRIMARY KEY, 
  input_data VARCHAR(255), 
  target_data VARCHAR(255) 
);

CREATE TABLE model ( 
  model_id INT PRIMARY KEY, 
  model_name VARCHAR(100), 
  accuracy FLOAT 
);

CREATE TABLE data (
    id INT PRIMARY KEY,
    input_data TEXT,
    timestamp TIMESTAMP
);

CREATE TABLE model (
    model_id INT PRIMARY KEY,
    model_name VARCHAR(50),
    last_updated TIMESTAMP
);

CREATE TABLE training_data (
    training_id INT PRIMARY KEY,
    data_id INT,
    model_id INT,
    accuracy FLOAT
);

CREATE TABLE Predictions (
    id INT PRIMARY KEY,
    prediction FLOAT,
    timestamp TIMESTAMP
);

CREATE TABLE ModelMetadata (
    id INT PRIMARY KEY,
    model_name VARCHAR(255),
    last_updated TIMESTAMP
);

CREATE TABLE TrainingLogs (
    id INT PRIMARY KEY,
    log_text TEXT,
    timestamp TIMESTAMP
);

CREATE TABLE data_updates (
    id SERIAL PRIMARY KEY,
    data_value VARCHAR(50) NOT NULL
);

CREATE TABLE model_parameters (
    id SERIAL PRIMARY KEY,
    parameter_name VARCHAR(50) NOT NULL,
    parameter_value FLOAT NOT NULL
);

CREATE TABLE training_data (
    id SERIAL PRIMARY KEY,
    feature1 FLOAT NOT NULL,
    feature2 FLOAT NOT NULL,
    label FLOAT NOT NULL
);

CREATE TABLE prediction_results (
    id SERIAL PRIMARY KEY,
    input_data_id INT NOT NULL,
    prediction_value FLOAT NOT NULL,
    timestamp TIMESTAMP
);

CREATE TABLE model_history (
    id SERIAL PRIMARY KEY,
    version INT NOT NULL,
    accuracy FLOAT NOT NULL,
    training_time FLOAT NOT NULL
);
